import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import '../../src/app.css';
import './flipcontactcard.css';

class FlipContactCard extends React.Component {
    render (){
        
        return(
            <div class="flip-card">
                <div class="flip-card-inner">
                    <Col class="flip-card-front" >
                        
                        <Row className="flip-card-front-text">John Doe</Row>
                        <Row className="flip-card-front-text">CEO</Row>
                    </Col>
                    <Row class="flip-card-back">
                        
                    </Row>
                </div>
            </div>    
        );
    }
}
export default FlipContactCard;
